    [],nt"revision_timestamp": "2016-07-27T22:20:30.045432",nt"name": "recreational-management-plan-kenai-national-moose-range",nt"isopen":
    false,nt"url": null,nt"notes": "The Kenai National Moose Range, located
    on the Kenai Peninsula, Alaska, was established by Executive Order 8979 on December
    I6, 1941. This action withdrew all lands and water from the public domain for wildlife
    purposes. The Moose Range, approximately 1,730,000 acres, contains an estimated
    145,000 acres of measurable water. There are about 1,200 lakes over 6 acres in size
    and ponds and small creeks abound in the area. The higher elevations are predominately
    alpine, tundra, and bare rock. The refuge is becoming increasingly important as
    a national recreation area. It is within weekend driving distance of more than one-half
    of Alaska's residents, and is open under State and Federal regulations to hunting,
    fishing, camping, and other outdoor recreation pursuits. Recreational visits have
    increased from 40,000 in 1959, to 102,000 in 19614, to 323,000 in 1968. Recreational
    use now exceeds one-half million visitor-use days each year. Within the next five
    years, this figure is expected to double. The proposed Turnagain Arm Causeway could
    triple and quadruple this figure. This plan is being rewritten to more accurately
    indicate the recreational goals of the Kenai Moose Range, and to follow the thinking
    outlined in the Master Plan.",nt"license_title": "License Not Specified",nt"extras":
